import React from "react";
import { Col, Row, Container } from "react-bootstrap";
import "./style.css";
import Topbar from "./Navbar";

function Cardie (props){
    return(

            <>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </>
    )
}

const Footer = () => {
    return (
        <div style={{color: '#aaaaaa', background: "#111111" , position: "absolute", left:"0" , right:"0"}}>
        <Container style={{paddingTop:"100pt", paddingBottom: "100pt"}}>
        <Row>

            <Col>
                <p>@</p>
            </Col>      
        </Row>
        </Container>
        <Topbar />
        </div>
     );
}

export default Footer;
